import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Button from "react-bootstrap/Button";
import YoutubeVideo from "../sub-components/YoutubeVideo";
import NoIngredients from "../sub-components/NoIngredients";

const Inside = (props) => {

    const [excludedIngredients, setExcludedIngredients] = React.useState([]);

    React.useEffect(() => {
        const fetchExcludedIngredients = async () => {
            const response = await fetch("/excluded-ingredients");
            const data = await response.json();

            setExcludedIngredients(data);
        }

        fetchExcludedIngredients();
    }, []);

    return (
        <section id="inside">
            <YoutubeVideo src={"https://www.youtube.com/embed/wQklne1hgS8"} />

            <div className="section">
                <Container>
                    <div className="section-inner">
                        <NoIngredients data={excludedIngredients} />
                    </div>
                </Container>
            </div>

            <div>
                <img className="w-100" src="images/icecream.png" alt="Ice Cream" />
            </div>

            <div id="comparison" className="section text-center">
                <Container>
                    <div className="section-inner">
                        <h1>And NOT (a lot) of sugar</h1>
                        <h3>Full-fat cream is the foundation of our recipe and why our label is lighter than other premium ice cream brands.</h3>
                    </div>

                    <div className="section-inner">
                        <h3>See for yourself:</h3>

                        <Row>
                            <Col md="6">
                                <img className="float-md-end mt-4 mb-4" src="images/nutri1.png" alt="" />
                            </Col>

                            <Col md="6" >
                                <img className="float-md-start mt-4 mb-4" src="images/nutri2.png" alt="" />
                            </Col>
                        </Row>
                    </div>

                    <div className="section-inner">
                        <Button variant="primary" href="/story">Let's Compare Sugar</Button>
                    </div>
                </Container>
            </div>
        </section>
    );
};


export default Inside;
